import React from 'react';
import './style.css';
import 'bootstrap/dist/css/bootstrap.css'


class LandingPage extends React.Component{

    
    render(){

        return (<div>
                    <div className="container">
                        <section>
                            <nav>
                                <span><h3 className="logo">CompanyName</h3></span>
                            </nav>
                        </section>
                    </div>
            </div>
        )
    }
}

export default LandingPage;
